			"desc" : "<p>Two fantasy walkabout characters carry their enormous loads, humming to themselves. Their roving, blinking eyes view the passersby with interest, and occasionally they issue a gigantic sneeze. When they slow to a halt they are spurred on by the little disgruntled passengers stowed away in the luggage.\r\n</p>",
