			"desc" : "<p>Nadara orchestra was born in 2001 in a small Transylvanian village in Romania. </p><p> Transylvania is a land where Romanian, Hungarian, German, Jewish and Roma (1) ethnics live side by side. The Transylvanian folklore is a very rich one, particularly in what regards its music and its dances. The Roma musicians have been offering the music for every community since hundreds of years and today as well. It is in this universe that the musicians of NADARA have grown up. They have had a familial musical inheritance, developing at the same time their own style, a new and innovating view about folk music. Notable the richness of their repertoire and the virtuosity of the musicians. </p>",
