			"desc" : "<p><b>STOP.THINK.GO. – Start it now!</b></p><p>Hoping for new and starting to act for change are two different things – how do we reach the point when we start to act? What are the things that help or pull us back and how can we master them?</p><p><b>Márti Barbarics - </b><b>Learn hard, play hard</b></p><p>We all know that students of today require a different type of education and the methods of the last century cannot serve the needs of our constantly changing world. What can we do instead and how can a teacher contribute to raise successful employees to-be? Games are entertaining us for thousands of years – what happens if we adapt some games to education? </p>",
