			"desc" : "<p><b><u>STOP. THINK. RESIST!</u></b></p><p>Don’t hold back anything, don’t stop, don’t think too much – or else you’ll lack behind. Life tends to help those who have the courage to resist and rebel. We all have the stereotypes based on which we make our decisions and verdicts, but in the meantime we admire those few who have the courage to opt for the unusual way. There is an increasing fight between general and special. Our inner values will decide the winning side. Stop for a minute and think it over. If life calls you to go against the crowd or fight with giants, what makes you to grab the chance?</p><p><b></b></p><p><b>JUDY ZHANG - FAR EASTERN IN EASTERN EUROPE</b></p><p>Judy is a freshly graduated secondary school student from Budapest, the home of more than 200 000 Chinese people. Why are we surprised if we meet a Chinese girl fluent in Hungarian? Judy tells us more about the multicultural hardships of living in Budapest and tries to bring closer the two nations she lives in. </p>",
