			"desc" : "<p><b><u>Stop. Think. Protect. – Protect and save it for the future!</u></b></p><p>Let’s save the world! It is easy to say but harder to do. Today’s 6 speakers think it differently. Let their field of focus be self-driving cars, scientific dissemination or slow fashion, they all work on making the world a sustainable, better and livable place. Come and check their talks within two concerts, it’s very likely that by the end of the day you’ll regard a car, your life and your old clothes differently.</p><p><b></b></p><p><b>Marcell Bővíz - The voice of the jungle</b></p><p>Biologist, parrot researcher, science communicator and explorer. This year he achieved his childhood dream and travelled to the Amazonian jungle, but the trip had some unexpected surprises. In his talk he shares how travelling changed his views on present and future. With his story Marcell would like to show us why it is worth leaving our fears behind and jump into the discovery of the world – and ourselves as well. </p>",
