			"desc" : "<p>What if Thor’s <i>Hammer of the Gods</i> from “Immigrant Song” landed in the hands of four wise, willful, and wild women? Well, it would sound something like Thunderpussy.</p><p>The quartet—Molly Sides [vocals], Whitney Petty [guitar], Leah Julius [bass], and Ruby Dunphy [drums]—do the most rock ‘n’ roll thing possible and quite literally fuck up every rock ‘n’ roll stereotype you know to be true. Instead of Page and Plant, Perry and Tyler, and Jagger and Richards, you get Molly and Whitney. Known for earth shattering pipes, heart-stopping performance art, and a propensity to literally writhe through a crowd, Molly is the consummate ideal front-person—bold, brilliant, brazen, and beautiful. At her righthand, you’ve got Whitney as the ultimate 21<sup>st</sup> century axe-slinger—cool, collected, and crazy on that fretboard. Rounding out the fray, Leah and Ruby cook up the tightest rhythm section this side of Cream (no kidding). </p><p>So, what is it that turned the Seattle-based group into a quiet phenomenon with the endorsement of <i>Rolling Stone</i> and Pearl Jam guitarist Mike McCready as well as a string of already legendary performances under their high-waisted belts (we’re looking at you, Sasquatch)? It’d be too easy say it’s the power of the P-----</p><p>Whitney steps in, “People talk about that magic. There’s some voodoo happening between Molly and I, which is like a cosmic connection. She has this power. Somehow, I’m under her spell when we’re performing—we all are.”</p><p>“The truth is, I feel the same way about Whitney, Leah, and Ruby,” smiles Molly. “We’re all in this together.”</p><p>That unity drives the band’s forthcoming full-length debut <i>Thunderpussy</i> [Stardog Records/Republic Records] produced by Sylvia Massy. The lead single <i>Speed Queen </i>begins with a revving engine and arena-size percussion before snapping into a muscular and majestic riff and vocal proclamation, <i>“Long live the Speed Queen.”</i></p><p>“The <i>‘Speed Queen’ </i>is this mythic and magical woman who rides a motorcycle and travels around the country,” explains Whitney. “Nobody knows too much about where she came from or where she’s going, but she changes everyone she meets because she’s that powerful. I was thinking of Molly when I wrote it.”</p><p>Among its arsenal, <i>Thunderpussy</i> also boasts a song produced by McCready “<i>Velvet Noose</i>.” Everything comes together into one cohesive and classic vision of rock music recharged, reinvigorated, and resurrected in what can only be described as a diamond in the muff: Thunderpussy.</p><p>“Being a lover of rock ‘n’ roll music for my whole life,” Whitney leaves off. “If you find it, cultivate it, treat it like a wild animal, and tame that raw energy, but not too much. That’s what this is.”</p>",
