			"desc" : "<p>'Meet You In The Maze’, the electro, synth-pop trio from Manchester, UK. Paul Sidman and Richard Parsons, both Producers/DJs, fronted by Jo Samuels, singer/songwriter who seduces you with her powerful vocal performance.</p><p>Jo met Paul and Richard on the international music scene and the collaboration formed ‘Meet You In The Maze’.</p><p>Their passion for electro, synth-pop, sometimes overlapping into house with Jo’s songwriting, their tracks began to form their debut album, 'Electric Blue', soon to be released. Jo knows how to transmit her deep lyrics into joy and passion through her vocal performance, recently singing at a number of European festivals and Prides.</p><p>Album in progress and ready for 2018!</p> \"She sings with utmost confidence... sassy, strident vocal... layers of delicious falsetto... melodically engaging\", Kerrang Magazine",
