			"desc" : "<p>Resident DJ of Buddha-Bar Budapest</p><p>Ahmed Khalil aka DJ Mada started his career at the age of 16, playing at the one and only local club in his hometown Suez, Egypt. Mada's<b> </b>love of music soon led him to clubs in Cairo, Alexandria, and in the early 90's he landed a DJ job in Hurghada. In few years, Mada played in some of the most prestigious venues across the Egyptian seaside.</p><p>In 2002 he moved to Hungary. Soon after his arrival to Budapest, Mada played at several underground clubs that paved the way for him to perform at events such as the world-famous Cinetrip spa party series, the vibrant MayDay gigs, and Sziget Festival.</p><p>Currently Mada is the resident DJ at the world-renowned Buddha-Bar in Budapest, playing a unique mix of chill-out, electronic and world music all featuring ethnic vibes true to Buddha Bar’s music concept. Given the opportunity by George V Entertainment, Mada has performed in Buddha Bar’s Paris several times ‘headquarters’, Buddha Bar StPetersburg, Little Buddha Sharm-el-Sheikh, Buddha-Bar Manila, Buddha Bar Baku, and most recently in Bushido Bahrain By Buddha Bar.</p>",
