			"desc" : "<p>Nixon started to show interest in electonic music around 1997. He found himself behind the decks in 2000, spinning techno and minimal music. Later on he has strated to play bigbeat, breakbeat and techbreak records which had ened up spinning ghetto-funk and funky breaks for the 10's. He's been hosting the radio show called Remiz alongside dj Vektor [Tilos] since 2004. As being one of the main composers of MustBeat Crew since 2007, he has delivered tracks and remixes for labels such as BreakbeatParadise Recordings, Timewarp Music, Fort Knox Recordings, Tru:Funk and Cast-A-Blast. The first record of him was released on a 7\" of Resense Records in 2010. </p>",
