			"desc" : "<p>The sonic outcome of Gábor Tokár's alterego Ficture is a collage of various sound sources, ranging from field recordings to analog synthesizers while keeping in mind that literally everything around us can be a potential part of music. Sound manipulation and resampling of self-recorded audio had a big role on Tokár's debut “Roads To Everywhere” released on Lemongrassmusic in 2014, Sound Colour Vibration described the EP as being “as soothing as it is intriguing”, while Funkadelphia called it “meticulously electronic, yet strikingly organic”. Tokár's other works include various cooperations as a session musician for bands, being a music producer and sound designer of different art projects, animations and collaborations in a wide range of styles.\r\n</p><p>Ficture's new EP 'Filled Spaces' was released on Audiobulb Records in April 2018, followed by a European tour presenting his live act as a simultaneous control over acoustic drums, various controllers, synths and effects used in an improvised way, combining live looping, sampling and DJing.</p>",
