			"desc" : "<p>The Dream Experiment is a sleeping installation creaded by the Sleeping Beauty Project, which takes the participants into a guided sleeping tour. The installation was created by objects we use every day and aims to boost up the senses of the sleepers. They limit and charge the sight, the hearing and the touch at the same time, while the participant’s body rests in a hammock. During the seance that lasts for one sleeping cycle only a given amount of people can take part, so keep an eye on the starting dates and don’t forget to register!\r\n</p><p>Lenght of show: between 2 pm and 5 pm continuously\r\n</p><p>Participants: János Brückner, Emil Tóth Márton, Zsófia Tamara Vadas</p>",
