			"desc" : "<p>What happens when dance and circus collide? When they converge, rub against each other, blend into one another?</p><p>Leading UK companies<b> </b>NoFit State Circus and Motionhouse bring together their unique styles in BLOCK, a powerful fusion of dance and circus that pushes the limits of both art forms. With its daring physicality, split-second timing and thrilling feats, BLOCK leaves audiences gasping.</p><p>Twenty oversized blocks, fashioned to resemble giant concrete Jenga blocks, are deconstructed and reformed into an infinite variety of shapes for the performers to play on, move with and explore. BLOCK is about life in the city; its contradictions and challenges.<br> <br> </p><p>Director: Kevin Finnan, Paul Evans</p><p>Performers: Andrew Davies, Onyemachi Ejimofor, Rosie Macari, Joel Pradas Reguill, Giorgia Setaro, Lee Tinnion, Laksmi Arco Valnei</p>",
