			"name" : "Cia Moveo – Conseqüències",
			"desc" : "<p>Cia Moveo – Conseqüències</p><p>Conseqüències is a work on the possibility of being out of step, late, off the mark and on the resulting consequences. If you stop for a moment to listen, to watch and the world keeps on going, how do you know what have you lost during this time? Was it even worth to stop? </p><p>Director: Stéphane Lévy</p> Performers: Marta Hervás, Xavi Palomino/Neilor Moreno, Núria Planes/Agnès Jabbour, Pino Steiner,<br><p>Adrià Viñas</p>",
