			"name" : "Elías Aguirre: Shy Blue",
			"desc" : "<p>As the oceans hide places and unknown creatures, people have something unknown inside of them, hidden behind the shyness barrier, an abyssal background lurks in the depths of themselves. Shyness acts often as a barrier of containment, preventing these forces from manifesting … but what is truly hidden behind a timid attitude or face? Is it possible to contain an “entity” whose true nature we do not know?</p><p>Director: Elías Aguirre</p><p>Performers: Richard Mascherin, Chey Jurado Giles, Elías Aguirre</p>",
