			"desc" : "<p>MANDELAS GUN is a political thriller, based on Mandelas African Odyssey. As Commander-in-Chief of the Liberation Army Umkhonto we Sizwe (the MK) he undergoes military training in Algeria and Ethiopia while surviving assassination attempts and betrayal. Mandela the Man is portrayed as a brilliant but complex warrior. The film celebrates a national and global icon a man who is dedicated to the overthrow of an infamous racist regime. MANDELA'S GUN reveals a man the world barely knows and how in 1962, in the final moments of his freedom, Mandela played a pivotal role in the fate of a nation.</p>",
