			"desc" : "<p>Joan Thiele was born in 1991 and she is of Italian, Swiss and Colombian heritage. Since childhood she lived a nomadic life - she has lived between Cartagena and Italy - and this gave her the chance to have an international music taste.</p><p>As soon as she finishes high school she moves to England to make music. She then develops a big artistic personality thanks to the music she listened to when she was a child - among her influences there are Led Zeppelin, Crosby, Stills, Nash &amp; Young together with many other contemporary electronic musicians. Her first EP was published in 2016 anticipated by the singles “Save Me” and “Taxi Driver”. The album contains 6 songs written by Joan and a cover of Lauryn Hills’ song “Lost Ones”. Joan then began to play live together with her band “Etna”. She was nominated Best New Artist at the MTV Awards 2016. In 2017 she has been chosen by Rai Radio Due to represent Italy at Eurosonic Norderslag in Groningen. Armenia, her last single anticipates the new album out in 2018.</p>",
