			"desc" : "<p>Ljósvaki (e. Aether, literally translated Awaker of Light) is the esoteric electronic-soul persona of Reykjavik born and raised Leifur Eiríksson. Coming from a background of breakdance and beatmaking his music is an eclectic mix of funk, soul hip hop, RnB and electronic beats. An aural chameleon, his performances never stay for long in the same place swiftly shifting between hymns, heavy beats and groovy playfulness.<o:p></o:p></p>",
