			"desc" : "<p>Hungarian film from 1918</p><p>97 minutes</p><p><b></b></p><p>The heiress of Rabkabánya, the Countess Éva Erlach, who was brought up in a girls’ boarding school, is received warmly by the employees of the mine, as they are fed up with the tyranny of Count Rudolf. Éva walks along the adits and she catches sight of a mysterious young man at the underground lake, named Jura the „Wise” who is said to be the son of Anna, the witch. However, it soon turns out the mysterious young man is no one else but the son of the deceased count Philip, himself believed to have been dead, as Count Rudolf attempted to murder him as an infant in order to lay his hands on his legacy. The little boy was saved by a monk and Anna was charged with raising him. Documents proving the birth of the young man are held by the old monk. Éva falls in love with Jura, committing everything in order to get the documents which certify his identity. Finally, all obstacles are removed and Jura takes possession of what is legally his with his young wife, Éva, by his side.</p><p>Live music by Ferenc Darvas</p>",
