			"name" : "Genesis",
			"desc" : "<p><span style=\"background-color: initial;\">The story of </span><i style=\"background-color: initial;\">Genesis </i><span style=\"background-color: initial;\">is formed around the fate of a young Roma boy, whose childhood reaches a sudden and drastic end when he loses his family in a tragic and brutal attack. Already buried in her work, a young female lawyer succumbs to pressure from her superior and undertakes the defence of one of the men facing trial for the part he reputedly played in this infamous series of racist murders. It is while researching the case that she comes into contact with the young boy, called as a witness, and this chance meeting changes both their lives forever. A mysterious teenage girl also becomes involved when her boyfriend’s dark secrets come to light.</span><br></p><p>Director: Árpád Bogdán</p>",
