			"name" : "The Butcher, the Whore and the One-eyed Man",
			"desc" : "<p><b style=\"background-color: initial;\">The Butcher, the Whore and the One-eyed Man</b><br></p><p><b></b></p><p>1925 saw a terrible scandal shake the city of Budapest. Ferenc Kudelka falls passionately in love with the ex-prostitute wife of a former gendarme by the name of Gusztáv Léderer, with the assistance and full knowledge of her husband: he is able to spend hours of pleasure with the man's wife in return for a small fee. Driven by greed, the Léderer couple - after two failed attempts - eventually succeeds in killing Kudelka. The film shows the perilous decline of three individuals as they are sucked into a world of sinful existence. It is the story of a wild and voracious love triangle. Related with brutal truth and raw realism, it tells a tale of meat, amour and maniacal murder.</p><p>Director: János Szász</p>",
