			"desc" : "<p><b>Balázs Magic Show</b></p><p>Travelling Funfair’s own magician, Balázs and his lovely assistant will join us again with their newest show several times a day. His relationship with magic started on a dull summer day, when one of his dad’s friends showed him a trick. It turned out almost immediately that Balázs is a real talent – even though he needed several years of practice, in 2016 he won the Corodini Championship, so now he has a paper to state what we already knew: he is the best magician in Hungary.</p><p><b></b></p><p><b>Sarkadi Bence: World Traveler Marionettes</b></p><p>Bence Sarkadi travels around the world with his self-created marionettes. Check out his solo performance and the unique story of his characters each day at the Travelling Funfair!</p><p><b></b></p><p><b>Fortune Tellers</b></p><p>Are you interested in knowing your future? Be brave, visit the fortune tellers, then wait patiently for your predicted future to come true!<b></b></p>",
