			"name" : "XS LAND",
			"desc" : "<p><u><b>Open: 11.00-19.00</b></u></p><p>XS Land is an adventure par, where NGOs that help disabled people, welcome Szitizens with a variety of interactive programs, games, and sport programs. It’s like a regular adventure park but here everything and everyone is a little different. How? Come to us to play, learn, and experience!</p><p>Programs of the XS Land:</p><p><u><b>Nem adom fel! Alapítvány I’m not giving up! Foundation</b></u></p><ul><li>-<b>Wheelchair obstacle race</b>: get through our carefully developed track and imagine what it would be like to struggle with the obstacles of an actual city!</li><li><b>-Blind labyrinth and dressing up based on a photo</b>: find your way out of the labyrinth blindfolded! Use your natural abilities, and the white stick will help you in orientation. When you reach the end, you will have to memorize a photo, and dress up based on it.</li><li>-<b>Palpable art:</b> come and make crafts with us! We will teach you that, “one sees well only with the heart” is not true. Try to see with your sense of feeling as well!</li><li>-<b>Artist’s tent:</b> Do handicrafts in new ways! Paint with your mouth, or try Japanese origami!</li><li>-<b>Get to know the most popular disabled sports:</b> Sitting volleyball, wheelchair basketball, ping pong throwing target.</li><li>-<b>Learning about the world of people with Down syndrome</b></li><li>-<b>Skittles</b></li><li>-<b>Blindfolded water gun fight!</b> Find your opponent by the sound of the bells attached to your wrists!</li><li>-<b>Siamese wheelchair:</b> Do our obstacle race with two wheelchairs bound together, using only one of your hands. Only for pros, and best friends!</li><li><b>Climbing wall: </b>Try out what it is like to climb blindfolded!</li></ul><p><u><b>Beszédes Kezek Kulturális és Oktatási Egyesület</b></u><br></p><p>Games with sign language, pantomime, and mimicry. We don’t speak the same language but this difference is easier to overcome than we might think!</p><p><u><b>Bliss Alapítvány </b></u><b>– 12-14</b><b>th</b><b> August</b></p><p>Through our programs, Szitizens have the opportunity to get acquainted with the different paper-based, and electric devices, and sound making machines used by our pupils.<br></p><p><u><b>DÉMOSZTHENÉSZ Beszédhibások és Segítőik Országos Érdekvédelmi Egyesülete</b></u></p><p>We welcome you with games connected to speech disability, and speech and language disorders.</p><p><u><b>Fogyatékos Személyek Esélyegyenlőségéért Közhasznú Alalpítvány</b></u></p><p>We want to raise awareness to autism through memory games, quizzes, true or false, and fact or fiction games.</p><p><u><b>Látássérültek Szabadidős Sportegyesülete</b></u></p><p>Blind soccer: Two teams of maximum 3 people - each blindfolded - play on a smaller field.<br></p><p>Showdown (blind ping pong): Get the rattling ball into the opponents net.</p><p>Darts: the blindfolded version of the traditional game.</p><p><u><b>Mozgáskorlátozottak Egyesületeinek Országos Szövetsége</b></u><br></p><p>Our communication and mobility-impaired colleagues also take part in the conduction of our interactive programs and talks.</p><p><u><b>NEO Magyar Segítőkutya Közhasznú Egyesület </b></u><b>11-12</b><b>th</b><b> August</b></p><p>Through our mini shows and demonstrations you can get to know how assistance dogs help their mobility impaired owners, what the tasks of an assistance dog for the hearing impaired are, and what do personal assistance dogs do, and who needs them.</p><p><u><b>Paradicsom Turisztikai Kulturális és Sport Klub</b></u></p><p>We welcome you with our tandem bike program.</p><p><u><b>SIGNALL</b></u></p><p>At the festival, we would like to present our Sign Language translator program to the hearing impaired Szitizens and to those who are interested.</p><p><u><b>Mozduljunk ki! Egyesület</b></u></p><p>Our team of volunteers of trained conductors and conductor students provide personal assistance for mobility impaired people, and those who use a wheelchair.</p>",
