			"title" : "World Music Stage",
			"desc" : "<p>What comes to mind when you hear the phrase: world music? In case you are not yet familiar with Sziget’s idea of world music than prepare yourself for endless dancing and fun. Come out and listen to a variety of music from all over the world! If you've been to Sziget you know what we mean… Immerse yourself in this cultural blend of music!</p><p><br></p>",
