			"desc" : "<p>Cirque du Sziget offers unique productions and impressive shows that will blow you away. In previous years, the circus venue at Sziget has been one of the most popular destinations, attracting many due to its special atmosphere! At the outdoor stage Szitizens have an opportunity to become part of the show, while inside the big tent they can simply sit back be amazed by sensational performances. So dear Szitizens, please get ready to welcome all the artists, acrobats and jugglers coming from all over the world!<br></p>",
