			"title" : "Before I Die",
			"desc" : "<p>This interactive community art project made by internationally well-known designer-artist Candy Chang encourages people to share their personal desires, secrets and fears in a common space. The giant board waits for Szitizens during the entire week to share their desires in life. The Sziget community can bulid this wall with their thoughts and dreams with completing the sentence: „Before I die…” </p><p>The wall has travelled the whole world and now returns to Sziget with a special addition: this year Szitizens can take part in a special video project by creating 10mp long messages about their wishes and plans which will be broadcast all night long. </p><p>The venue operates each day between 12:00-22:00</p>",
