			"title" : "GameLandHub",
			"desc" : "<p>At GameLandHub you can play a variety of games including darts, board games, videogames and Rubik's cube. Challenge your friends to the newest PS4 and Xbox games. Take Rubik’s cube and darts lessons - or if you’re good enough, compete against others! Board games also offer a fun opportunity to engage with other festival-goers and compete in a friendly way. Let your your inner child break free, come and play!</p><p><span class=\"fontstyle0\">Due to legal restrictions real money play is not allowed! It is strictly forbidden in the Tent, but also on the area of the whole festival! If you have a gambling addiction please call the following number: </span><span class=\"fontstyle2\">+36 30 951 6815</span> <br></p>",
