			"desc" : "<p><span style=\"background-color: initial;\">An interactive exhibition is waiting for you about the atom energy and the Paks II. project int he most popular music festivals of Hungary. Get to know more about the atom energy, the 4 blocks of Paks and about the Paks II. project on our interactive boards! Take a virtual walk in a VVER1200 atomic powerstation, test your knowledge on our test machines and take a part on our QR-code game!</span><br></p><p>The interactive exhibition will not only inform you, but it’s entertaining as well! With the help of the power generating bicycle you can expert how many energy you need to exert to operate an everyday use item. You can charge your phone at the Energy Island, roll the lottery-wheel and choose a lottery ticket. And if you prefer to relax a little bit, you can do it on our hammocks and beanbags while you are gaining your knowledge about tha Paks II. and the atom energy as well.</p>",
