			"title" : "Kolinmobile and Picnic Gallery",
			"desc" : "<p>Kolinmobile and Picnic Gallery were converted from two old camp trailers to create a moving art space. Mark Linczenyi musician and Peter Weiler graphic artist dreamt this oasis in Sziget for live music and fine art. Come and enjoy our concerts, live DJ-sets, take part in our music and street art workshops. Or just come and chill.</p>",
