			"title" : "WAMP Design Fair",
			"desc" : "<p>WAMP design fair will take care of all the needs of design and fashion fans all week during the festival. The hippest local designers offer you their selected collections in cool colourful Hello Wood wooden houses, where you can buy the best outfits, bags and accessories for the parties, and also get the latest festival glitter body painting.</p><p>More information: <a href=\"http://www.wamp.hu\">www.wamp.hu</a><br> <a href=\"https://www.facebook.com/wampdesignvasar/?ref=aymt_homepage_panel\">https://www.facebook.com/wampdesignvasar/?ref=aymt_homepage_panel</a></p>",
