			"title" : "​Catch it! All that is fish",
			"desc" : "<p>Was it a long night, are you lack of energy? There is a solution! If you take to the Catch it! stand at the Sziget Festival, you will be really able to feel like a fish in the water! You can even taste the fishy delicacies! After a long night with full of parties it feels good to eat some crispy fish with remulad sauce, smoked silver carp paste, or spicy fishball. Visit the Sziget Wine village and look for the “Kapj rá!” –“Catch it” stand. We are waiting for you with delicious fish dishes every afternoon from 12:00-20:00. Whirl the lottery-wheel between two baits, answer the questions right and win our surprise presents! And if you have a desire to get to know new recipes and interesting information, read our printed brochure at the stand and surprise your family or friends with delicious dishes at home too! The Catch it! campaign comestrue in the co-financing of The European Maritime And Fisheries Found (EMFF) and Hungary, in order to stimulate the fish consumption.<br></p>",
