			"desc" : "<p><b>Deichmann Pop-Up Store &amp; Design Workshop</b></p><p>Dress up your feet in festival style too!</p><p>Between two stages visit the Deichmann Pop-Up Store, where you can get not even the trendiest festival shoes but you will be able to test your creativity as well.</p><p>At our Design Workshop you can mix your unique shoes every afternoon that has nobody else at the whole festival. The patterns, colours and the airbrushes are covered by us –the less depends on your creativity!</p><p>What else is waiting for your at the Pop-Up Store? Choose from our classic sneakers, comfortable festival slippers or –if needed- a trendy gumboots. Be our guest for a cocktail* and chill in our armchairs while your phone is charging!</p><p>*set to purchase</p><p>Open every day between 10am and 8pm.</p>",
