			"desc" : "<p>One of the most spectacular venues of this year's Sziget festival can be connected to the Rézangyal. Like the previous years you can enjoy the Hungarian Brandy, called Pálinka every day at the festival, at the <b>Rézangyal Pálinka Bar</b>. You can <b>try more than 30 types of Pálinka</b> and the luckiests can enjoy the main stage concerts on the roof terrace, as well as <b>the coolest Fundango x Rézangyal gifts of the festival </b>are waiting for you at Rézangyal Pálinka Bar. So… Do we have a Pálinka?\r\n</p>",
